function makepdf(candidates_company,candidates)
{
  //MAKING THE PDF WITH JSPDF
  let doc = new jsPDF()
  let width =  210
  let height = 297

  let img_bck='data:image/jpeg;base64,'
  doc.addImage(img_bck, 'JPEG', 0, 0, width, height) 

  let x=25
  let y=70
  let offsetx=60
  let offsety=100
  
  let imgData = 'data:image/jpeg;base64,'
  doc.addImage(imgData, 'JPEG', 55, 15, 100, 20) 
  
  doc.setFontSize(30)
  doc.text(candidates_company, width/2, 50, 'center')

  doc.setFontSize(15)
  let cnt=0
  for(let i=0;i<2;i++)
  {
    for(let j=0;j<3;j++)
    {
      if(cnt>=candidates.length)
      {
        continue;
      }
      doc.text(candidates[cnt].fname+' '+candidates[cnt].lname, x+25+offsetx*j, y+60+offsety*i, 'center')
      doc.text(candidates[cnt].stream+' '+candidates[cnt].year, x+25+offsetx*j, y+70+offsety*i, 'center')
      doc.text(candidates[cnt].a_pack, x+25+offsetx*j, y+80+offsety*i, 'center')
      cnt++
    }
      
  }

  var reader = new FileReader();  
  readFile(0)

  function readFile(index)
  {
    if(index >= candidates.length) 
    {
      window.open(doc.output('bloburl'))
      return;
    }

    var file = candidates[index].file_link;
    if(file)
    {
      reader.readAsDataURL(file)
      reader.onload = function(e)
      {   
        var bin = e.target.result;

        let row = Math.floor(index / 3)
        let col = index % 3

        doc.addImage(bin, "JPG", x+offsetx*col, y+offsety*row, 50, 50)
        readFile(index+1)
      }
    }
    else
    {
      readFile(index+1)
    }
    
  }
  
  // doc.save("Sample pdf")
  // window.open(doc.output('bloburl'))
}

